import React from "react";

export default function Navbar({ cartCount, onCartClick }) {
  return (
    <nav style={{ padding: "10px", background: "#333", color: "white" }}>
      <h2 style={{ display: "inline-block", marginRight: "20px" }}>üõç My Store</h2>
      <button 
        onClick={onCartClick} 
        style={{ background: "orange", padding: "5px 10px", border: "none", cursor: "pointer" }}
      >
        Cart ({cartCount})
      </button>
    </nav>
  );
}
